import Team from './Team';
import Event from './Event';
import MapResult from './MapResult';
import Stream from './Stream';
import Player from './Player';
interface Match {
    team1?: Team;
    team2?: Team;
    date: number;
    format: string;
    additionalInfo?: string;
    event: Event;
    maps: MapResult[];
    streams: Stream[];
    players: {
        [key: number]: Player[];
    };
    title?: string;
    live: boolean;
}
export default Match;
